              this.setState({name:mst.target.value});
            }

                  //input email
       HandleNameInput=(mst)=>
       {
         this.setState({name:mst.target.value});
       }

      //input phone
      HandlePhoneInput=(mst)=>
      {
        this.setState({Phone:mst.target.value});
      }

      //Submitform
     HanleSubmitForm=()=>
     {
          alert(this.state.name)
     }

    
    render() {
        return (<>
            <div className="container p-5">
            <form>
     <div class="form-group">
    <label>FirstName</label>
    <input type="Name" 
    class="form-control" value={this.state.name} 
     onChange = {this.HandleNameInput.bind(this)}/>
    
     </div>
  

     <div class="form-group">
    <label>LastName</label>
    <input type="First_Name" 
    class="form-control" value={this.state.name} 
     onChange = {this.HandleNameInput.bind(this)}/>
    
     </div>

     <div class="form-group">
    <label>Name</label>
    <input type="Name" 
    class="form-control" value={this.state.name} 
     onChange = {this.HandleNameInput.bind(this)}/>
    
     </div>

     <div class="form-group">
    <label>Name</label>
    <input type="Name" 
    class="form-control" value={this.state.name} 
     onChange = {this.HandleNameInput.bind(this)}/>
    
     </div>
     <button type="submit" class="btn btn-primary"
     onClick={this.HanleSubmitForm}>Submit</button>
     
     </form>
            </div>
            
        </>);
    }
}

export default Signup;
